  namespace: DataLayer
  summary: >-
    Searches the dictionary for a <code>HorizontalStar</code> using the Hip ID provided. If found, converts it to a T star, stores it and returns it.

    If not found, retrieves it from the dictionary of stars already converted and returns it.
  example: []
  syntax:
    content: public T GetConstellationStar(int hipId, Func<HorizontalStar, T> SpawnStar)
    parameters:
    - id: hipId
      type: System.Int32
      description: The Hipparcos Id of the star
    - id: SpawnStar
      type: System.Func{DataLayer.HorizontalObjects.HorizontalStar,{T}}
      description: The function provided to spawn a new star in the graphic scene. Must take a <code>HorizontalStar</code> as and argument and return a <code>T</code> star
